Insert selective columns into collection using mongodb<p>Wrote a trigger function that inserts  full documents to my collection <code>new_list</code> when ever there is an insert into <code>listingsAndReviews</code> collection.</p>

<pre><code>exports = function(changeEvent) {

    const fullDocument = changeEvent.fullDocument;

    const collection = context.services.get('Cluster0').db("sample_airbnb").collection("new_list");


    return collection.insertMany([fullDocument])
  .then(result =&gt; {
    console.log(`Successfully inserted ${result.insertedIds.length} items!`);
    return result;
  })
  .catch(err =&gt; console.error(`Failed to insert documents: ${err}`));

};
</code></pre>

<p>Is there a way to select only particular required columns while inserting data into new_list collection.
In this case i need to insert only name and cart_id and ignore others. </p>

<p>My sample collection column names : </p>

<pre><code>name     - string
cart_id   - objectid
number - string
address - string
</code></pre>

