Refactoring Express code and cannot figure out variable scope<p>I hope this is not a silly question.  I have a homepage route that loads up a lot of mongo databases, and I originally had it loop through the mongo databases and add them to an array that was rendered to a webpage.  However, the databases have become more complicated and they need to be populated, so I can no longer use a loop to accomplish this, and needed to refactor to getting the databases individually.  However, I seem to be having problems with the variable's scopes, as they are always returned as empty outside of the .find function.
My original code was this:</p>

<pre><code>    const collections = [User, Ticket, Client, Job, Transaction];
    let endCollections = [];
    for (let i = 0; i &lt; collections.length; i++){
        await collections[i].find({}, function(err, foundCollection){ 
            if (err) {
                console.log(err);
            } else {
                endCollections[i] = foundCollection;                
            }
        });
    }
    res.render("dashboard", {transactions: endCollections[4], clients: endCollections[2], tickets: endCollections[1], jobs: endCollections[3]});
</code></pre>

<p>And this worked fine.  But I need to populate the individual databases, so this was no longer useful.  I rewrote it out to populate, but I am having problems changing the global variables inside of the functions.  Here is the new code I am trying:</p>

<pre><code>    let transactions = [],
    clients = [],
    jobs = [],
    tickets = [];

    await Transaction.find({}).populate("job").populate("client").populate("deposited_by_user").exec(function(err, foundTransactions){
        if(err){
            console.log(err)
        } else {                                        
            for (let i = 0; i &lt; foundTransactions.length; i++){
                foundTransactions[i]["transaction_info"]["new_amount"] = numberWithCommas(foundTransactions[i]["transaction_info"]["amount"]);
            }
        }
        transactions = foundTransactions;
    });

    await Client.find({}).populate("transactions").populate("jobs").exec(function(err, foundClients){
        if(err){
            console.log(err)
        }
        clients = foundClients;
    });

    await Ticket.find({}).populate("created_by").populate("assigned_user").populate("completed_by_user").exec(function(err, foundTickets){
        if(err){
            console.log(err)
        }
        tickets = foundTickets;
    });

    await Job.find({}).populate("created_by").populate("client").populate("transactions").exec(function(err, foundJobs){
        if(err){
            console.log(err)
        }
        jobs = foundJobs;
    }); 

    res.render("dashboard", {transactions: transactions, clients: clients, tickets: tickets, jobs: jobs});
</code></pre>

<p>For example, if I console.log "jobs" right after the line jobs = foundJobs;, it will show the jobs array being populated.  However, if I console.log "jobs" right before the res.render, it shows it as empty.  Considering the global variable endCollections in my original code seemed to be changed within the functions before, I am unsure why my new code does not do the same as everything is returned empty.  I know that somehow the scope of the variable is what is wrong here, but I cannot see how.  Is there something obvious I am missing?  Thanks.</p>

