Mongoose: how to automatically remove old entries form an array?<p>I have a messaging app, that can display messages threads. In order not to bother with pagination, endless api calls and performance issues, I would like to automatically delete messages older than x days in an array in order to keep a small a amount of data.</p>

<p>How to do it? If it is not possible, how to automatically remove the oldest element from an array if it already has 50 elements while trying to push a new message? I could do it with native javascript, but maybe there is a cleaner way?</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const mongoose = require("mongoose");

const conversationSchema = new mongoose.Schema(
  {
    name: { type: String, required: true, unique: true },
    messages: [{ message: { type: String }, authorId: { type: String } }],
    lastMessage: {
      authorId: { type: String },
      snippet: { type: String },
      read: { type: Boolean },
