Why mongodb java driver uses random bytes instead of machine id in ObjectId?<p>Many people say that ObjectId consist of:</p>

<ul>
<li>a 4-byte value representing the seconds since the Unix epoch (which will not run out of seconds until the year 2106)</li>
<li>a 3-byte machine identifier (usually derived from the MAC address),</li>
<li>a 2-byte process id, and</li>
<li>a 3-byte counter, starting with a random value.</li>
</ul>

<p>And if the objectId contains all these elements then it's guaranteed that all ids are unique across the cluster. But the docs say that there're no machine and process ids and the objectId contains just a random value (<a href="https://docs.mongodb.com/manual/reference/method/ObjectId" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/method/ObjectId</a>)</p>

<p>I looked in the java mongo driver ObjectId generation and found the evidence:</p>

<pre><code>SecureRandom secureRandom = new SecureRandom();
RANDOM_VALUE1 = secureRandom.nextInt(0x01000000);
RANDOM_VALUE2 = (short) secureRandom.nextInt(0x00008000);

// ...

private ObjectId(final int timestamp, final int counter, final boolean checkCounter) {
    this(timestamp, RANDOM_VALUE1, RANDOM_VALUE2, counter, checkCounter);
}
</code></pre>

<p>So, it's possible (ok, the probability is really low, but still) that two machines generate the same random numbers and all the consequently generated ids will have clashes very probably. Why such decision has been made? Is it still perfectly unique, but I don't understand something? 
Thanks!</p>

<p><strong>Edit:</strong> Well, the purpose of the question is: should I implement the retrieving of MAC address and processId and generate ObjectId by myself or leave random 5 bytes number, because there's no difference?</p>

